import React, { useState, useMemo, useEffect } from 'react';
import './boq.css';
import { Slider } from '@mui/material';
import ProductForm from './form';
import { supabase } from './supabase';
import 'primereact/resources/themes/saga-blue/theme.css'; // Theme CSS
import 'primereact/resources/primereact.min.css'; // Core PrimeReact CSS
import 'primeicons/primeicons.css'; // PrimeIcons
import 'primeflex/primeflex.css'; // PrimeFlex grid system (optional)

import { DataTable } from 'primereact/datatable';
import { Column } from 'primereact/column';
import { Skeleton } from 'primereact/skeleton';
import Card from './Card'; // Import Card component

const App = () => {
  const [searchQuery, setSearchQuery] = useState('');
  const [priceRange, setPriceRange] = useState([1000, 5000]);
  const [compareList, setCompareList] = useState([]);
  const [productsData, setProductData] = useState([]);

  async function getProducts() {
    return await supabase.from('products').select();
  }

  useEffect(() => {
    getProducts().then(async ({ data, error }) => {
      if (error) {
        console.error(error);
        return;
      }
      let newData = [];
      for (let ind in data) {
        let obj = data[ind];
        const { data: Photo, error: PhotoError } = await supabase.storage
          .from('addon')
          .createSignedUrl(`${obj.image}`, 3600);
        console.log(PhotoError);
        const { data: addons, error: addonsError } = await supabase
          .from('addons')
          .select()
          .eq('productid', obj.id);
        let addonsList = [];
        for (let adn in addons) {
          let adf = addons[adn];
          const { data: Photo2, error: PhotoError2 } = await supabase.storage
            .from('addon')
            .createSignedUrl(`${adf.image}`, 3600);
          console.log(PhotoError2);
          addonsList.push({ ...adf, image: Photo2.signedUrl });
        }
        newData.push({ ...obj, addons: addonsList, image: Photo.signedUrl });
      }
      setProductData(newData);
    });
  }, []);

  const handleSearch = (event) => {
    setSearchQuery(event.target.value.toLowerCase());
  };

  const handleSliderChange = (event, newValue) => {
    setPriceRange(newValue);
  };

  const handleCompareToggle = (product) => {
    setCompareList((prevCompareList) => {
      if (prevCompareList.includes(product)) {
        return prevCompareList.filter((item) => item !== product);
      } else {
        return [...prevCompareList, product];
      }
    });
  };

  return (
    <div className="App">
      <div className="search-filter">
        <input
          type="text"
          placeholder="Search products..."
          value={searchQuery}
          onChange={handleSearch}
          className="search-bar"
        />
        <Slider
          value={priceRange}
          onChange={handleSliderChange}
          valueLabelDisplay="auto"
          min={1000}
          max={5000}
          className="price-slider"
        />
      </div>

      <div className="products-grid">
        {productsData && productsData.length > 0 ? (
          productsData.map((product, index) => (
            <div key={index}>
              <Card
                title={product.title}
                price={product.price}
                details={product.details}
                addOns={product.addons || []} // Ensure addOns is at least an empty array
                image={product.image}
                initialMinimized={product.initialMinimized || false}
              />
            </div>
          ))
        ) : (
          <p>No products available</p>
        )}
      </div>

      {/* PrimeReact DataTable */}
      <DataTable value={productsData} className="p-datatable-striped">
        <Column field="title" header="Title" style={{ width: '25%' }} />
        <Column field="price" header="Price" style={{ width: '25%' }} />
        <Column field="details" header="Details" style={{ width: '25%' }} />
        <Column
          field="addons"
          header="Add-Ons"
          style={{ width: '25%' }}
          body={(rowData) =>
            rowData.addons && rowData.addons.length > 0 ? (
              rowData.addons.map((addon, index) => (
                <span key={index}>
                  {addon.name} (+â‚¹{addon.price}){' '}
                </span>
              ))
            ) : (
              <span>No Add-Ons</span>
            )
          }
        />
      </DataTable>

      <ProductForm />
    </div>
  );
};

export default App;
